import React from "react";
import "./Header.css";
import Menu from './Menu';

function Header(props) {
  const { greeting, hola, bonjour } = props;
  return (
    <header className="App-header row">
      <div class="col-md-2"> Logo </div>
      <Menu />
    </header>
  );
}

export default Header;
